          "id": "c751429b0c0f8ed800801eaf87988c67d8ed94d5",
          "message": "JIT: ignore bus interactions & reduce block machine row range (#2322)\n\nI noticed that JITing never succeeds if we run with `--linker-mode bus`.\nThis PR fixes it, as can be verified by running this with debug log:\n```\n$ RUST_LOG=debug cargo run pil test_data/std/binary_large_test.asm -o output -f --linker-mode bus\n...\nSecondary machine 0: main_binary (BlockMachine): 18 / 18 blocks computed via JIT.\n72 of 128 rows are used in machine 'Secondary machine 0: main_binary (BlockMachine)'.\n\n == Witgen profile (484 events)\n   67.2% (    5.6s): JIT-compilation\n   19.1% (    1.6s): Secondary machine 0: main_binary (BlockMachine)\n   11.2% ( 944.5ms): FixedLookup\n    1.5% ( 124.4ms): multiplicity witgen\n    0.8% (  69.3ms): witgen (outer code)\n    0.1% (  10.4ms): Main machine (Dynamic)\n  ---------------------------\n    ==> Total: 8.397369458s\n```\n\nDoing so, I came across an issue cause by the block machine processor\nprocessing rows `-1..(self.block_size + 1)`: It can actually write to\nthe first row of the next block, in which case we\n[panic](https://github.com/powdr-labs/powdr/blob/1ee15050a987beacd0eea36b7384bade48c51936/executor/src/witgen/jit/function_cache.rs#L124),\nbecause we don't have that row yet. It would also be pretty annoying to\nneed to support that and not needed in practice. But it turns out, this\nrow range was actually more generous that what we use in the run-time\nsolver, see [this\nline](https://github.com/powdr-labs/powdr/blob/1ee15050a987beacd0eea36b7384bade48c51936/executor/src/witgen/sequence_iterator.rs#L41)!\nSo I'm reducing it in this PR.",
          "timestamp": "2025-01-14T13:39:43Z",
          "tree_id": "69f7b38c8e1894cd262e96c12b621d950a0aeb54",
