          "id": "bb5905dd4b745577b4070010043887b754d18e43",
          "message": "Human-readable formatting of JIT witgen (error) state. (#2352)\n\nThis formats the incomplete identities in the following way:\n\nFor each identity, the first half is the full form, the second half is a\nsimplified form that takes known values into account (but it does not\nhave to be affine).\n\nFor each half, the first line is the expression, the second contains\nknown values and the third contains known range constraints.\n\n```\n--------------[ identity on row on row -1: ]--------------\nmain::add_two_state' = (((1 - main::RESET) * (main::add_two_state + 1)) + (main::RESET * main::add_two_input'))\n                 ??? =                  1                     ???                    1                    ???  \n                     =                                                                                         \nmain::add_two_state' = main::add_two_input'\n                 ??? =                  ???\n                     =                     \n--------------[ identity on row on row 0: ]--------------\nmain::add_two_state' = (((1 - main::RESET) * (main::add_two_state + 1)) + (main::RESET * main::add_two_input'))\n                 ??? =                  0                     ???                    0                    ???  \n                     =                                                                                         \nmain::add_two_state' = (main::add_two_state + 1)\n                 ??? =                  ???     \n                     =                          \n--------------[ identity on row on row 0: ]--------------\n0 = ((1 - main::RESET) * (main::add_two_input - main::add_two_input'))\n  =                 0                     ???                    ???  \n  =                                                                   \n0 = (main::add_two_input - main::add_two_input')\n  =                  ???                    ??? \n  =                                             \n--------------[ identity on row on row 1: ]--------------\nmain::add_two_state' = (((1 - main::RESET) * (main::add_two_state + 1)) + (main::RESET * main::add_two_input'))\n                 ??? =                  0                     ???                    0                    ???  \n                     =                                                                                         \nmain::add_two_state' = (main::add_two_state + 1)\n                 ??? =                  ???     \n                     =                          \n--------------[ identity on row on row 1: ]--------------\n0 = ((1 - main::RESET) * (main::add_two_input - main::add_two_input'))\n  =                 0                     ???                    ???  \n  =                                                                   \n0 = (main::add_two_input - main::add_two_input')\n  =                  ???                    ??? \n  =                                             \n--------------[ identity on row on row 2: ]--------------\nmain::add_two_state' = (((1 - main::RESET) * (main::add_two_state + 1)) + (main::RESET * main::add_two_input'))\n                 ??? =                  1                     ???                    1                    ???  \n                     =                                                                                         \nmain::add_two_state' = main::add_two_input'\n                 ??? =                  ???\n                     =    \n```",
