          "id": "76f87f3d8cb95522e65516bfca15bb4e29ce21b2",
          "message": "Fix fixed lookup that contains constants (#2371)\n\nThis is something I came across in #2361: The `FixedLookupMachine` does\nnot recognize lookups of the form `[...] in [col1, col2, 3, col4]`. The\nreason that this was not an issue before is that the PIL optimizer\nsimplifies such lookups. But it does not if they are represented as bus\ninteractions.\n\nWith this PR, the `FixedLookupMachine` looks for either fixed columns or\ncompile-time constants on the RHS.",
