          "id": "814028506df2384370b8b8762018e04b211bf7ef",
          "message": "Process identities in order (if possible) (#2323)\n\nNeeded for the automatic pre-compile experiments @leonardoalt is\nrunning.\n\nChanges the order in which **runtime** witgen for block machines\nprocesses identities.\n\n### Motivation\n\nThe problem this solves is that sometimes processing an identity has\nside effects, specifically links to memory: the order in which you\nexecute them matters.\n\nIn practice, this is usually not an issue, because:\n- In the main machine, rows are processed in order anyway, and rows\ncorrespond to time steps of the computation.\n- A machine like\n[`Keccakf16Memory`](https://github.com/powdr-labs/powdr/blob/main/std/machines/hash/keccakf16_memory.asm)\nonly reads and writes each address once, and the value to write depends\non the read value, so in order to do the write, the read needs to happen\nfirst. This is guaranteed by the current algorithm.\n\nBut in the general case, there is no guarantee, because witgen doesn't\nknow about the notion of time. For example, if the value written is a\nconstant, it can be executed by witgen as soon as the address is known,\neven if there is also a read of a smaller time step.\n\nThe workaround that this PR implements is that identities are processed\n*in the order they appear in PIL*, as much as possible. In particular,\nan identity will only be processed, if no previous identity (or the\nouter query or any prover function) led to a progress.\n\nWith this, the user can get witgen to execute memory operations in the\ncorrect order. This issue came up by some pre-compile experiments of\nLeo.\n\n### Implementation\n\nThe previous algorithm processed a given row like this:\n```python\nprogress = True\nwhile progress:\n  progress = False\n  for identity in identities:\n    progress |= process(identity)\n  progress |= process(prover_queries)\n  progress |= process(outer_query)\n```\n\nWith this PR, we do this:\n```python\nwhile round():\n  pass\n\ndef round():\n  if process(outer_query):\n    return True\n  if process(prover_queries):\n    return True\n  for identity in identities:\n    if process(identity):\n      return True\n  return False\n```\n\nWhat this gets us is that an identity is only executed *if no previous\nidentity identity has made progress*. The order of identities is the\norder in which it appears in the PIL (I think!). This allows us to\ncontrol the order in which stateful machine calls, like memory accesses,\nare executed.\n\nI guess this can make the solving of the first block significantly\n(afterwards, the sequence cache should remove any identities that did\nnot lead to progress). As an upper bound, witgen for\n`test_data/std/keccakf16_memory_test.asm` takes 347s now (instead of 309\non `main`) :)",
