          "distinct": false,
          "id": "3a423329e2692d63c00776205d4fc5bbd0b3a2fa",
          "message": "Witgen: Use bus natively (#2361)\n\nDepends on #2371\n\nThis PR introduces a new `Identity`, which is similar to\n`powdr_ast::analyzed::Identity`, but it only has \"bus send\" and \"bus\nreceive\" variants, instead of (phantom) lookup / permutation / bus\ninteraction. Any lookup or permutation gets translated to an equivalent\npair of bus interactions. This abstracts how the machine connection is\nimplemented exactly.\n\nRight now, we assume that each bus send and receive has a compile-time\ninteraction ID, by which they can be statically matched. This is always\nthe case if the interaction originated from a lookup or permutation, so\nthis is fully backward-compatible.\n\nBut what this already gives us is many-to-one relationships: We can have\nseveral sends with the same interaction ID, that map to the same\nreceive. As a result, we can drastically remove the number of receives,\nas Thibaut is doing in #2359.\n\nAs a next step, we can also make the send interaction ID dynamic, which\nallows for a reduction of sends. For that, we need to relax the\nassumption that the interaction ID is known at compile time and match\nwhile solving the constraint system.\n\n### Benchmark results\n```\nexecutor-benchmark/keccak\n                        time:   [11.928 s 12.248 s 12.611 s]\n                        change: [-5.4383% -2.0982% +1.2884%] (p = 0.26 > 0.05)\n                        No change in performance detected.\n```\n\n---------\n\nCo-authored-by: chriseth <chris@ethereum.org>",
