          "id": "526b51d28c69cac27bb05acf43778d072702b2d5",
          "message": "Reverse fingerprint order (#2405)\n\nThis PR changes the fingerprint of a tuple $(x_1, ..., x_n)$:\nfrom\n$\\sum_{i=1}^n \\alpha^{(n - i)} x_i$\nto\n$\\sum_{i=1}^n \\alpha^{(i - 1)} x_i$\n\nThe difference is that previously, you could pad any number of zeros to\nthe left and get the same fingerprint. Now, you can pad any number of\nzeros to the right, which I find more intuitive.\n\nThis also fixes a potential soundness bug: In practice, we always use\n`fingerprint_with_id`, which prepends the bus ID to the payload, e.g.\n`(<BUS_ID_FOO>, a, b, c)` & `(<BUS_ID_BAR>, a, b)`. But\n`fingerprint((<BUS_ID_BAR>, a, b)) == fingerprint((0, <BUS_ID_BAR>, a,\nb))`, so if `BUS_ID_FOO` is `0`, the receiver could be ambiguous.\n\nThis is fixed now, because every bus interaction will at least\nfingerprint the bus ID, which is always the first element.",
          "timestamp": "2025-01-29T09:45:51Z",
          "url": "https://github.com/powdr-labs/powdr/commit/526b51d28c69cac27bb05acf43778d072702b2d5"
