          "id": "ecdd5745fd2bd4465923ae12f2374491c46f92d9",
          "message": "Separate Bus Receives from Identities (#2402)\n\n#2361 introduced a new `Identity` type, which could be - among other\nthings - a bus send or a bus receive. Also, there was another map from\nbus ID to receive.\n\nActually, the receives are not needed in the list of identities, so I\nremoved them from the type entirely. They were ignored everywhere\nanyway. As a bonus, we can now also remove the\n`BusReceive::interaction_id`.",
